import React from 'react';
import './styles.css'; // Import your CSS file

const MainPage = ({ username }) => {
  return (
    <div className="centered">
      <h2>Welcome, {username}!</h2>
      <h3>Tables</h3>
      <ul>
        <li>Table 1</li>
        <li>Table 2</li>
        <li>Table 3</li>
      </ul>
    </div>
  );
};

export default MainPage;
